import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const HeroSection = () => {
  return (
    <div className="hero-section bg-primary text-white text-center py-5">
      <div className="container">
        <h1 className="display-4">Empowering Your Business</h1>
        <p className="lead">
          Simplifying complex challenges with tailored solutions.
        </p>
        <a href="/about" className="btn btn-light btn-lg mr-2">Discover Our Solutions</a>
        <a href="/contact" className="btn btn-outline-light btn-lg">Get in Touch</a>
      </div>
    </div>
  );
};

export default HeroSection;
